import React, { useEffect } from 'react'
import Axios from 'axios'

const MyNotes = () => {

    const url = "http://localhost:3002";
    const token = localStorage.getItem("token");

    const getNotes = () => {
        Axios.get((url + "/notes"), {
            headers: {
                "token": `${token}`
            }
        }).then((response) => {
            console.log("notes ", response)
        })
    }

    useEffect(() => {
        getNotes();
    })

    return (
        <div>
            <h1>My notes</h1>
        </div>
    )
}

export default MyNotes
